import './App.css';
var style={
  width:100,
  height:100,
  color:"red",
  background:"white",
  bordr:2,
  border:"white"
}


class App extends Component {
  render() {
    return (
      <div className="App">
        <header className="App-header">
          <div style={style}>hello</div>
        </header>
      </div>
    );
  }
}

export default App;
